// import PropTypes from 'prop-types'

export default function Alert(props) {
  return (
    props.alert && <div className={`alert alert-success alert-dismissible fade show`} role="alert" data-bs-theme={props.mode}>
        <strong>{props.alert.type}</strong> {props.alert.msg}
        <button type="button" className="btn-close" data-bs-dismiss="alert" ria-label="Close"></button>
      </div>
    // {/* </> */}
  );
}
